import React from 'react';
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-size: 15px;
`;
const Header = styled.div`
  width: 100%;
  text-align: center;
  font-size: 30px;
  border-bottom: 1px solid black;
`;
const Content = styled.div`

`;
const Footer = styled.div`
  position: fixed;
  bottom: 0;
`;


function App() {
  return (
    <Container>
      <Header>
        Lee Kwanyoung
      </Header>
      <Content>
        <About></About>
        <Experience></Experience>
        <Project></Project>
        <Skill></Skill>
      </Content>
    </Container>
  );
}

export default App;
